id=sl_svn200_9251

><td class="source">// they have special allowances for multiple jQuery versions by<br></td></tr
><tr
id=sl_svn200_9252

><td class="source">// specifying define.amd.jQuery = true. Register as a named module,<br></td></tr
><tr
id=sl_svn200_9253

><td class="source">// since jQuery can be concatenated with other files that may use define,<br></td></tr
><tr
id=sl_svn200_9254

><td class="source">// but not use a proper concatenation script that understands anonymous<br></td></tr
><tr
id=sl_svn200_9255

><td class="source">// AMD modules. A named AMD is safest and most robust way to register.<br></td></tr
><tr
id=sl_svn200_9256

><td class="source">// Lowercase jquery is used because AMD module names are derived from<br></td></tr
><tr
